import { Link } from "react-router-dom";
import { Helmet } from "react-helmet";
import doctor2 from "../asset/doctor2.jpg";
import sispakdelogo from "../asset/sispakdelogo.png";

export default function Home() {
  return (
    <>
      <Helmet>
        <title>Home</title>
      </Helmet>

      {/* CARD KIRI */}
      <div className="grid grid-cols-1 sm:grid-cols-2 h-screen w-full">
        <div className="hidden sm:block">
          <div className="h-full w-full bg-white">
            <img className="h-screen mx-auto" src={doctor2} alt="DOCTOR" />
          </div>
        </div>

        {/* CARD KANAN */}
        <div className="bg-gray-800 flex flex-col justify-center">
          <div className="max-w-[400px] w-full mx-auto bg-gray-900 p-8 px-8 rounded-lg">
            <div className="flex border border-white justify-center">
              <img
                src={sispakdelogo}
                alt="SISPAKDE LOGO"
                className="w-16 h-16"
              />
              <h2 className="my-auto text-4xl text-white font-bebas font-bold text-center tracking-widest">
                SISPAKDE
              </h2>
            </div>
            <div className="flex flex-col text-gray-400 py-2">
              <p>loremipsum</p>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
